  `show_agent_exchange` int(11) DEFAULT '1' COMMENT '是否显示代理兑现(0关闭1开启)',
  `show_bank_transfer` int(11) DEFAULT '1' COMMENT '是否显示银行转账(0关闭1开启)',
  PRIMARY KEY (`package_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

